import React from 'react'
import './Product.css'

const Product = ({ product }) => {
  return (
    <main className="prod-wrap">
        <img src={product.image} alt="" />
        <h4 className="product-name">{product.name}</h4>
        <p className="product-price">{product.price}</p>
    </main>
  )
}

export default Product
